import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 58.1-1211 Branch banks.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/58.1-1211.md","filePath":"vacode/58.1-1211.md"}'),r={name:"vacode/58.1-1211.md"},n=o('<h1 id="§-58-1-1211-branch-banks" tabindex="-1">§ 58.1-1211 Branch banks. <a class="header-anchor" href="#§-58-1-1211-branch-banks" aria-label="Permalink to &quot;§ 58.1-1211 Branch banks.&quot;">​</a></h1><p>If any bank has offices located in two or more political subdivisions, which includes cities, towns and counties, the tax which may be imposed by any subdivision under §§ <a href="http://law.lis.virginia.gov/vacode/58.1-1208/" target="_blank" rel="noreferrer">58.1-1208</a>, <a href="http://law.lis.virginia.gov/vacode/58.1-1209/" target="_blank" rel="noreferrer">58.1-1209</a> or § <a href="http://law.lis.virginia.gov/vacode/58.1-1210/" target="_blank" rel="noreferrer">58.1-1210</a> shall be imposed upon only such proportion of the taxable value of the net capital under § <a href="http://law.lis.virginia.gov/vacode/58.1-1204/" target="_blank" rel="noreferrer">58.1-1204</a> as the total deposits of such bank, or offices located inside the taxing subdivision, bears to total deposits as of the end of the preceding year. For the purposes of this section, offices located within an incorporated town shall be deemed not within the county where such banks are located.</p><p>Code 1950, § 58-485.012; 1980, c. 578; 1984, c. 675.</p>',3),i=[n];function s(c,h,l,d,_,p){return a(),t("div",null,i)}const u=e(r,[["render",s]]);export{b as __pageData,u as default};
